import React from "react";
import { Link } from "react-router-dom";
import "../App.css";

export default function Home() {
  return (
    <>
      {/* Hero Section */}
      <section
        className="vh-100 d-flex align-items-center justify-content-center text-center position-relative hero-section"
        style={{
          backgroundImage:
            "url('https://media.everlane.com/image/upload/c_scale,dpr_1.5,f_auto,q_auto,w_auto/v1/i/40df86dd_2f14.jpg')",
          backgroundSize: "cover",
          backgroundPosition: "center",
          color: "#fff",
        }}
      >
        {/* Dark Overlay */}
        <div className="position-absolute top-0 start-0 w-100 h-100 overlay"></div>

        <div className="position-relative container">
          <h1 className="display-4 fw-bold text-shadow animate__fadeInDown">
            Exceptional Quality.
          </h1>
          <p className="lead mt-3 text-shadow animate__fadeInUp">
            Ethical factories. Radical transparency.
          </p>
          <Link
            to="/women"
            className="btn btn-light btn-lg mt-4 fw-bold shadow-sm hero-btn animate__fadeInUp"
            style={{ borderRadius: "30px" }}
          >
            Shop Women
          </Link>
          <Link
            to="/men"
            className="btn btn-outline-light btn-lg mt-4 fw-bold ms-3 shadow-sm hero-btn animate__fadeInUp"
            style={{ borderRadius: "30px" }}
          >
            Shop Men
          </Link>
        </div>
      </section>

      {/* Category Section */}
      <section className="container-fluid p-0 my-5">
        <div className="row g-0">

          {/* Women Category */}
          <div className="col-md-6 p-0">
            <Link to="/women" className="text-decoration-none d-block">
              <div className="position-relative overflow-hidden category-card hover-zoom">
                <img
                  src="https://media.everlane.com/image/upload/c_scale,dpr_1.5,f_auto,q_auto,w_auto/v1/i/287f132e_2c66.jpg"
                  className="img-fluid w-100 d-block transition-scale"
                  alt="Women"
                />
                <div className="position-absolute bottom-0 start-0 p-4 text-white bg-gradient p-4">
                  <h3 className="fw-bold mb-0">Women</h3>
                  <p className="small">Latest collections & essentials</p>
                </div>
              </div>
            </Link>
          </div>

          {/* Men Category */}
          <div className="col-md-6 p-0">
            <Link to="/men" className="text-decoration-none d-block">
              <div className="position-relative overflow-hidden category-card hover-zoom">
                <img
                  src="https://media.everlane.com/image/upload/c_scale,dpr_1.5,f_auto,q_auto,w_auto/v1/i/397553c9_0b0b.jpg"
                  className="img-fluid w-100 d-block transition-scale"
                  alt="Men"
                />
                <div className="position-absolute bottom-0 start-0 p-4 text-white bg-gradient p-4">
                  <h3 className="fw-bold mb-0">Men</h3>
                  <p className="small">Modern essentials & casual wear</p>
                </div>
              </div>
            </Link>
          </div>
        </div>
      </section>

      {/* Feature Section */}
      <section className="container my-5 text-center">
        <h2 className="mb-4 fw-bold">Why Choose Us</h2>
        <div className="row">
          <div className="col-md-4 mb-4 animate__fadeInUp">
            <div className="p-4 shadow-sm rounded bg-light h-100">
              <h4>Ethical Production</h4>
              <p>All products made in ethical factories with fair labor practices.</p>
            </div>
          </div>
          <div className="col-md-4 mb-4 animate__fadeInUp" style={{animationDelay: "0.2s"}}>
            <div className="p-4 shadow-sm rounded bg-light h-100">
              <h4>Radical Transparency</h4>
              <p>Clear pricing, sourcing, and sustainability practices for every item.</p>
            </div>
          </div>
          <div className="col-md-4 mb-4 animate__fadeInUp" style={{animationDelay: "0.4s"}}>
            <div className="p-4 shadow-sm rounded bg-light h-100">
              <h4>Premium Quality</h4>
              <p>Designed to last, with high-quality materials and timeless style.</p>
            </div>
          </div>
        </div>
      </section>

      {/* Call to Action */}
      <section
        className="py-5 text-white text-center"
        style={{
          backgroundImage:
            "url('https://media.everlane.com/image/upload/c_scale,dpr_1.5,f_auto,q_auto,w_auto/v1/i/0f1f5b4e_6e8f.jpg')",
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      >
        <div className="overlay" style={{ backgroundColor: "rgba(0,0,0,0.6)" }}></div>
        <div className="position-relative container">
          <h2 className="fw-bold mb-3 text-shadow">Discover Our Collections</h2>
          <Link
            to="/shop"
            className="btn btn-light btn-lg fw-bold shadow-sm"
            style={{ borderRadius: "30px" }}
          >
            Start Shopping
          </Link>
        </div>
      </section>

      {/* Inline CSS for animations and hover */}
      <style>{`
        .overlay {
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
        }
        .text-shadow {
          text-shadow: 2px 2px 12px rgba(0,0,0,0.7);
        }
        .bg-gradient {
          background: linear-gradient(to top, rgba(0,0,0,0.6), transparent);
          width: 100%;
        }
        .transition-scale img {
          transition: transform 0.5s ease;
        }
        .transition-scale:hover img {
          transform: scale(1.05);
        }
        .hover-zoom {
          overflow: hidden;
        }
        .hover-zoom img {
          transition: transform 0.5s ease;
        }
        .hover-zoom:hover img {
          transform: scale(1.08);
        }
      `}</style>
    </>
  );
}
